d:      .zero 16384
T1:     .zero 16384
T2:     .zero 16384
alpha: 	.word 1
beta:   .word 1
N:      .word 64

.text
        la  s1, a
        la  s2, b
        la  s3, c
        la  s4, d
        la  s5, T1
        la  s6, T2
        lw  s7, alpha
        lw  s8, beta
        lw  s9, N

        # Preliminary part: ... #


        # First part: T1 = A*B #

        # Initialization of auxiliaries:
        addi t0, zero, 4 #
        mul a3, s9, t0   # a3 -> 4*N
        add a0, zero, s1 # a0 -> *A
        add a1, zero, s2 # a1 -> *B
        add t0, zero, a1 # t0 -> *auxB = B
        add a2, zero, s5 # a2 -> *T1

        # for(i=0,...,...){
        add t1, zero, zero
f1loop1:
        # for(j=0,...,...){
        add t2, zero, zero
f1loop2:
        # for(k=0,...,...){
        add t3, zero, zero
        # aux1 = 0
        add t4, zero, zero
f1loop3:
        # ... += A[i][k] * ...
        lw t5, 0(a0)
        # ... += ... * B[k][j]
        lw t6, 0(t0)
        # ... += A[i][k] * B[k][j]
        mul t5, t5, t6 
        # aux1 += A[i][k] * B[k][j]
        add t4, t4, t5
        # A++
        addi a0, a0, 4
        # auxB += N*4 (moves to the next row)
        add t0, t0, a3
        # for(...,...,k++)
        addi t3, t3, 1 
        # for(...,k<N,...)
        blt t3, s9, f1loop3
        # }
        # T1[i][j] = aux1;
        sw t4, 0(a2)
        # T1++
        addi a2, a2, 4
        # A -= N*4 (rewind to the first element of the row)
        sub a0, a0, a3
        # B++
        addi a1, a1, 4
        # auxB = B
        add  t0, zero, a1
        # for(...,...,j++)
        addi t2, t2, 1
        # for(...,j<N,...)
        blt t2, s9, f1loop2
        # }
        # A += N*4 (moves to the next row)
        add a0, a0, a3
        # B -= N*4 (rewind to the first element of the row)
        sub a1, a1, a3
        # auxB = B
        add t0, zero, a1
        # for(...,...,i++)
        addi t1, t1, 1
        # for(...,i<N,...)
        blt t1, s9, f1loop1
        # }


        # Second part: D = alpha*T1 + beta*C #

        # Initialization of auxiliaries:
        addi t0, zero, 4 #
        mul a3, s9, t0   # a3 -> 4*N
        add a0, zero, s3 # a0 -> *C
        add a1, zero, s4 # a1 -> *D
        add a2, zero, s5 # a2 -> *T1

        # for(i=0,...,...){ #Order in now IJ
        add t1, zero, zero
f2loop1:  
        # for(j=0,...,...){ 
        add t0, zero, zero 
f2loop2:
        # ... = ... + ...*C[i][j]
        lw t2, 0(a0)
        # ... = ...*T1[i][j] + ...
        lw t3, 0(a2)
        # ... = alpha*T1[i][j] + ...
        mul t4, s7, t3
        # ... = ... + beta*C[i][j]
        mul t5, s8, t2
        # aux1 = alpha*T1[i][j] + beta*C[i][j]
        add t5, t5, t4
        # D[i][j] = aux1;
        sw t5, 0(a1)
        # C += N*4 (moves to the next column (not row))
        addi a0, a0, 4
        # D += N*4 (moves to the next column (not row))
        addi a1, a1, 4
        # T1 += N*4 (moves to the next column (not row))
        addi a2, a2, 4
        # for(...,...,j++ (instead of i++))
        addi t0, t0, 1
        # for(...,j<size (still compare to N, but now j))
        blt t0, s9, f2loop2
        # }
        # C -= N*N*4 (still rewinds back to 1st element) 
        add a0, zero, s3
        # D -= N*N*4 (rewind to the first element of the matrix) 
        add a1, zero, s4
        # T1 -= N*N*4 (rewind to the first element of the matrix) 
        add a2, zero, s5
        # for(...,...,i++ (after a full row computed, add to i))
        addi t1, t1, 1
        # aux2 = i*4 (go i columns down) and Aux has to be t0, not t1
        add t0, zero, a3
        mul t0, t0, t1
        # C += aux2
        add a0, t0, a0
        # D += aux2
        add a1, t0, a1
        # T1 += aux2
        add a2, t0, a2  
        # for(...,i<N,... (Finally check if i is <N, if not loop back))
        blt t1, s9, f2loop1
        # }


        # return
        li a7, 10
        ecall